import { Link, Navigate } from 'react-router-dom';

const Home = () => {
  return (
    <div className='home'>
      <h1>Home</h1>
      <Link to='/login'>Login</Link>
      <Link to='/register'>Register</Link>
    </div>
  );
};

export default Home;
